import { View, Text, StyleSheet, Image, ImageBackground } from 'react-native'
import React from 'react'
import logo from "../images/logo.png";
import Button from '../components/Button';


const image = { uri: "https://bdrentz.com/media/files/vendor/5/komatsu-excavator.jpg" };
export default function Home() {

    const handleSubmit = ()=>{
        console.log("submitted");
    }
  return (
    <View style={styles.container}>
    <ImageBackground source={image} resizeMode="cover" style={{flex:1}}>
            <View style={styles.headerTopArea}>
                <View>
                    <Text>Logo</Text>
                </View>   
                <View>
                    <Text style={styles.headerTitle}>THE LARGEST</Text>
                    <Text style={styles.headerTitle}>EQUIPMENT RENTAL NETWORK</Text>
                </View>   
            </View>
            <View style={styles.headerButtomArea}>
               <View>
                  <Button label="LOGIN AS CUSTOMAR" onPress={handleSubmit} />
               </View>     
               <View>
                  <Button label="LOGIN AS VENDOR" onPress={handleSubmit} />
               </View>     
            </View>
    </ImageBackground>
    </View>
  )
}

const styles = StyleSheet.create({
    container:{
        flex:1,
    },
    headerTopArea:{
        flex:0.7,
        justifyContent:"space-around",
        backgroundColor:"#fff",
        alignItems:"center",
        borderBottomEndRadius:40,
        borderBottomStartRadius:40
    },
    headerButtomArea:{
        flex:1
    },
    headerTitle:{
       fontSize:20,
       textAlign:"center"
    }
})
